import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import { connect } from 'react-redux';
import firebase from '../../firebaseTest.js';

import {
    Button,
    TextField,
    AppBar
} from '../../components';
import './styles.css';

class MoveComponent extends Component {

    render(){
        return(
        <div style={{margin:'10px'}}>
            <AppBar /> 
            <h2>Please Login</h2>
            <TextField id='user' placeholder='username' style={{marginBottom:'10px'}}/><br/>
            <TextField id='password' type='password' placeholder='password' style={{marginBottom:'10px'}}/>
                <br/>
            <Button primary content='login' style={{marginBottom:'10px'}}/>
            <Button content='reset' style={{marginLeft:'20px'}}/>
        </div>
        )
    }
}
export { MoveComponent };

const mapStateToProps = (state, ownProps) => {
    return {
        ...ownProps
    };
};

export const Move = connect(mapStateToProps, {

})(MoveComponent);
